import React from "react";
import samboLogo from "../assets/samboLogo.PNG";
import codeLogo from "../assets/file-code.svg";
import workLogo from "../assets/briefcase.svg";
import aboutMeLogo from "../assets/file-earmark-person.svg";
import contactLogo from "../assets/phone.svg";

function Header() {
  return (
    <header className="header">
      <div id="headerInfo">
        <p id="headerIntro">
          I <span style={{ color: "#00bfff" }}>'</span> M
        </p>
        <p id="headerName">SAM</p>
        <p id="headerTitle">
          <b>FULL STACK SOFTWARE DEVELOPER</b>
        </p>
      </div>
      <div id="headerCircle">
        <img
          id="samboLogo"
          src={samboLogo}
          alt="cartoon logo of Sam LaChapelle"
        />
      </div>
      <div id="navBar">
          <img className="navBarIcons" style={{color: "white", minHeight: "3em", minWidth: "3em"}} src={codeLogo} alt="projects navigation button"/>
          <img className="navBarIcons" src={workLogo} alt="work navigation button"/>
          <img className="navBarIcons" src={aboutMeLogo} alt="about me navigation button"/>
          <img className="navBarIcons" src={contactLogo} alt="contact navigation button"/>
      </div>
    </header>
  );
}

export default Header;
